import React from 'react';

export default function CalendarNavigation({ onPrevClick, onNxtClick, navigationText }) {
  return (
    <div className="ta-c">
      <button type="button" className="btn btn-primery btn-calendar btn-lg" onClick={onPrevClick}>
        <i className="fa fa-angle-left " />
      </button>
      <span className="navigation-text">{navigationText()}</span>
      <button type="button" className="btn btn-primery btn-calendar btn-lg" onClick={onNxtClick}>
        <i className="fa fa-angle-right promoIcon" />
      </button>
    </div>
  );
}
